import Link from 'next/link'

const linkStyle = {
  marginRight: 15
}
const services_array = ["Solutions", "Projects", "Gear", "Music", "Contact"];
export default function Header() {
  return (
    <nav class="navbar fixed-top navbar-expand-lg toggle-height" id="global-nav">
      <div class="container">
        <a class="navbar-brand scrollN" className="scrollN" href="/">Prabhakar Mishra</a>
        {services_array.map(service => (
          <Link href={`/${service}`}>
            <button style={linkStyle}>
              <span>{service}</span>
            </button>
          </Link>
        ))}
      <style jsx>{`
        .scrollN {
          font-size : 1em;
          color: white;

        }
        `}</style>
        </div>
    </nav>
  )
}
